import React from 'react';
import { Table } from 'reactstrap';

const TableRow = ({user}) => {
    let favColorStyle = {
        backgroundColor: user.color
    }
    return (
        <tr>
            <td className="pa3 bb b--black-10">
                <div className="flex items-center">
                    {user.name}
                </div>
            </td>
            <td className="pa3 bb b--black-10">
                {user.email}
            </td>
            <td className="pa3 bb b--black-10">
                <div className="flex items-center">
                    {user.color}
                </div>
            </td>
        </tr>
    )
}
export default TableRow;
